export const fetch_activity_order = () => {
  return {
    type: 'FETCH_ACTIVITY_ORDER',
    payload: {
      query: `
        {
          activityOrder(date: "2019-08-09", orderId: 54){
            className
            message
            createdAt
            id
            photoUrlsJson
          }
        }
      `
    }
  }
}
